import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getproblemsuper, status_update, Problemplus } from '../utils/ApiRequest';
import axios from 'axios';

function Complaint({ handle_view }) {
  const navigate = useNavigate();
  const [refresh, setRefresh] = useState(false);
  const [problem, setProblem] = useState([]);
  const [currId, setCurrId] = useState(null);
  const [Show, setShow] = useState(false);
  const [status, setStatus] = useState('');

  const handleViewClick = (a) => {
    handle_view(a);
    navigate('/image');
  };

  useEffect(() => {
    const fetch_problem = async () => {
      try {
        const user = JSON.parse(localStorage.getItem("super"));
        const { data } = await axios.post(getproblemsuper);
        const problems = data.problem;

        const currentTime = new Date();
        const filteredProblems = problems.filter(problem => {
          const problemTime = new Date(problem.createdAt);
          const timeDifference = currentTime - problemTime;
          return timeDifference > 300000 && problem.status === 'pending';
        });

        const problemWithUserId = await Promise.all(filteredProblems.map(async problem => {
          const { data: userData } = await axios.post(Problemplus, { userId: problem.userId });
          return { ...problem, userId: userData.userId }; // Assuming userId is the correct key
        }));

        setProblem(problemWithUserId);
      } catch (error) {
        console.error('Error fetching problems:', error);
        // Handle error (e.g., show an error message)
      }
    };

    if (localStorage.getItem("super")) {
      fetch_problem();
    } else {
      navigate("/superadminlogin");
    }
  }, [refresh, navigate]);

  const handleEditSubmit = async (e) => {
    e.preventDefault();
    console.log(currId);
    const id=currId;
    const {data} = await axios.post(status_update, {status,id});

    if(data.success === true){
      await handleClose();
      await setRefresh(!refresh);
      window.location.reload();
    }
    else{
      console.log("error");
    }
  };

  const handleClose = () => {
    setShow(false);
  };
  const handleShow = () => {
    setShow(true);
  };

  const handleEditClick = (itemKey) => {
    console.log("Clicked button ID:", itemKey);
      handleShow();
      setCurrId(itemKey);
  };

  return (
    <div>
      <div className="mfs-list-table-container">
        <table className="mfs-list-table">
          <thead>
            <tr>
              <th>Complaint Lodged On</th>
              <th>Complaint Lodged By</th>
              <th>Complainant</th>
              <th>Status</th>
              <th>Image</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {problem.map(item => (
              <tr key={item.id}>
                <td>{item.createdAt}</td>
                <td>{item.userId}</td>
                <td>{item.problem}</td>
                <td>{item.status}</td>
                <td>
                  <button onClick={() => handleViewClick(item.Image)}>View</button>
                </td>
                <td>
                  <div className="icons-handle">
                    <button
                      key={item._id}
                      id={item._id}
                      className="btn btn-warning"
                      onClick={() => handleEditClick(item._id)}
                    >
                      open
                    </button>
                    {Show === true ? (
                      <>
                        <div className="openform">
                          <form method="POST">
                            <label htmlFor="">Remarks</label>
                            <input
                              type="text"
                              name='status'
                              placeholder='Write it here..'
                              value={status}
                              onChange={(e) => { setstatus(e.target.value) }}
                            />
                            <button type='button' onClick={handleClose}>close</button>
                            <button type='submit' className='btn btn-success' onClick={handleEditSubmit}>submit</button>
                          </form>
                        </div>
                      </>
                    ) : (
                      <></>
                    )}
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Complaint;
